import React, {useState} from 'react'
import {saveUser} from "../api/user"

import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogTitle from '@material-ui/core/DialogTitle';
import { Button } from '@material-ui/core';

const DeletePopUp = (props) => {

    return(
        <Dialog
        open={props.opened}
        onClose={(e) => {props.closeDeleteForm()}}>
            <DialogTitle>S'enregistrer</DialogTitle>
            <DialogContent>
                <p>Voulez vous r√©ellement supprimer l'utilisateur {props.user}</p>

            </DialogContent>
            <DialogActions>
                <Button color="primary" onClick={(e) => {props.closeDeleteForm()}}>Annuler</Button>
                <Button color="primary">Supprimer</Button>
            </DialogActions>
        </Dialog>
    )
}

export default DeletePopUp
